import styled from "styled-components";

export const Container = styled.div`
  display: flex;
  width: 100%;
  align-items: center;
  justify-content: center;
  flex-direction: column;

  form {
    margin-top: 24px;

    input {
      margin-right: 8px;
      border: 1px solid black;
      color: black;
      padding: 4px;
    }
    span {
      color: red;
      font-size: 18px;
    }
  }
`;
